import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Attempt XSS payload in the search input
    const xssPayload = `<img src=x onerror=alert('xss')>`;
    await page.fill('#searchInput', xssPayload);

    // Take screenshot after entering payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Try to trigger the search (using button or Enter key)
    // Try button first
    let searchBtnFound = false;
    const btns = await page.$$('.search-btn');
    if (btns.length > 0) {
      await btns[0].click();
      searchBtnFound = true;
    } else {
      // Fallback: press Enter in the input
      await page.press('#searchInput', 'Enter');
    }

    // Wait for possible results or any DOM update
    await page.waitForTimeout(1000);

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Try to extract any visible evidence of XSS (e.g., <img> tag with onerror or alert box)
    // We'll look for any <img> tag with src="x"
    const xssImgExists = await page.$('img[src="x"]') !== null;

    // Also try to extract any HTML that contains our payload
    const pageContent = await page.content();
    const payloadPresent = pageContent.includes(xssPayload);

    return {
      success: true,
      action: "Attempted XSS via search input and triggered search",
      extractedData: {
        xssImgExists,
        payloadPresent,
        searchBtnFound
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
